import React, { Component } from 'react'

export class ActivityPost extends Component {
  render() {
    return (
      <div>
        <p>{this.props.post.user}</p>
        <p>{this.props.post.text}</p>
        <p>{this.props.post.at}</p>
      </div>
    )
  }
}

export default ActivityPost
